angular.module("boilerplate-templates",[]).run(["$templateCache",function($templateCache){$templateCache.put("app/components/index/index.html",'<div class="filters">\n    <label>\n        Ordenar Por&nbsp;\n    </label>\n    <select ng-model=\'sort\'>\n        <option value="name">Nome</option>\n        <option value="-price">Preço(Maior para o Menor)</option>\n        <option value="price">Preço(Menor para o Maior)</option>\n    </select>\n    <span class="spandex"></span>\n</div>\n<div class="wrapper">\n    <div class="product" status="{{product.status}}" ng-repeat=\'product in products | orderBy:sort\'>\n        <section class="image" ng-class=\'product.position\' ng-style=\'{\n            "background-image": "url(" + product.image + ")"\n        }\'></section>\n        <section class="content">\n            <p>\n                {{product.name}}\n            </p>\n            <p>\n                <strong class="price">{{product.price | finance:true:2}}</strong>\n            </p>\n            <form method="post" target="pagseguro" action="https://pagseguro.uol.com.br/v2/checkout/payment.html">\n                <input name="receiverEmail" type="hidden" value="grillorafael@gmail.com">\n                <input name="currency" type="hidden" value="BRL">\n\n                <input name="itemId1" type="hidden" value="0001">\n                <input name="itemDescription1" type="hidden" value="{{product.name}}">\n                <input name="itemAmount1" type="hidden" value="{{product.price | toFixed}}">\n                <input name="itemQuantity1" type="hidden" value="1">\n\n                <input name="encoding" type="hidden" value="utf8">\n\n                <button>\n                    Comprar\n                </button>\n                <!-- <input alt="Pague com PagSeguro" name="submit" type="image" src="https://p.simg.uol.com.br/out/pagseguro/i/botoes/pagamentos/120x53-pagar.gif" /> -->\n            </form>\n        </section>\n    </div>\n\n</div>')}]);